import React from "react";

export const socialData = [
  {
    id: 1,
    icon: "icon",
    url: "https://www.facebook.com"
  },
  {
    id: 2,
    icon: <FaTwitter className="icon" />,
    url: "https://www.facebook.com"
  },
  {
    id: 3,
    icon: <FaLinkedin className="icon" />,
    url: "https://www.facebook.com"
  }
];
